import './App.css';
import Navbar from './components/Navbar';
import DailySum from './components/DailySum';
import Collections from './components/Collections';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <DailySum/>
      <Collections/>
    </div>
  );
}

export default App;
